import React from 'react';
import logo from './logo.svg';
import './App.css';
import { store } from './Actions/Store';
import { Provider, connect, link } from 'react-redux';
 import Usuario from './Components/Usuarios';
// import Genero from './Components/Generos';
// import Filme from './Components/Filmes';
// import Locacao from './Components/locacaos';
import { Container } from "@material-ui/core";
import { ToastProvider } from 'react-toast-notifications'
import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";

// const Usuario = () => <div>Usuários 123</div>
const Genero = () => <div>Genero</div>
const Filme = () => <div>Filme</div>
const Locacao = () => <div>Locacao</div>
const usuario3 = ({ match }) => <div>{match.url}</div>

function App() {
  return (
    <Router>
    <Provider store={ store }>
      <ToastProvider autoDismiss={true}>
        <Container maxWidth = "lg">
        <div>

          <ul>
            <li><Link to="/Usuarios">Usuários 321 </Link></li>
            <li><Link to="/Generos">Gêneros </Link></li>
            <li><Link to="/Filmes">Filmes </Link></li>
            <li><Link to="/Locacoes">Locações </Link></li>
          </ul>
        </div>
        <hr/>
        <Switch>
        <Route path="/usuario" component={ Usuario } />
        <Route path="/genero" component={ Genero } />
        <Route path="/filme" component={ Filme } />
        <Route path="/locacao" component={ Locacao } />
        </Switch>
          <Locacao />
        </Container>
      </ToastProvider>
    </Provider>
    </Router>
  );
}

export default App;
